import {BrowserRouter, Routes, Route} from 'react-router-dom';
import {homePage, resultPage, admainPage} from "src/pages";

function App(){
  return(
    <BrowserRouter>
     <Routes>
        <Route path="/" element={<homePage />}/>
        <Route path="/result" element={<resultPage />}/>
        <Route path="/admain" element={<admainPage />}/>
      </Routes>
    </BrowserRouter>    
  );
}
export default App;
